{ "_id" : { "$oid" : "5668b18743887bdd5bf174c8" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第14条（準拠法・裁判管轄）  本規約の解釈にあたっては，日本法を準拠法とします。  本サービスに関して紛争が生じた場合には，当組織の本店所在地を管轄する裁判所を専属的合意管轄とします。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第14条（準拠法・裁判管轄）  本規約の解釈にあたっては，日本法を準拠法とします。  本サービスに関して紛争が生じた場合には，当組織の本店所在地を管轄する裁判所を専属的合意管轄とします。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:56:07.283+0900" }, "update_date" : { "$date" : "2015-12-10T07:56:07.283+0900" }, "deleted" : false }
{ "_id" : { "$oid" : "5668b19e43887bdd5bf174c9" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第13条（権利義務の譲渡の禁止）  ユーザーは，当組織の書面による事前の承諾なく，利用契約上の地位または本規約に基づく権利もしくは義務を第三者に譲渡し，または担保に供することはできません。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第13条（権利義務の譲渡の禁止）  ユーザーは，当組織の書面による事前の承諾なく，利用契約上の地位または本規約に基づく権利もしくは義務を第三者に譲渡し，または担保に供することはできません。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:56:30.048+0900" }, "update_date" : { "$date" : "2015-12-10T07:56:30.048+0900" }, "deleted" : false }
