{ "_id" : { "$oid" : "5668b1bc43887bdd5bf174cb" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第11条（利用規約の変更）  当組織は，必要と判断した場合には，ユーザーに通知することなくいつでも本規約を変更することができるものとします。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第11条（利用規約の変更）  当組織は，必要と判断した場合には，ユーザーに通知することなくいつでも本規約を変更することができるものとします。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:57:00.699+0900" }, "update_date" : { "$date" : "2015-12-10T07:57:00.699+0900" }, "deleted" : false }
{ "_id" : { "$oid" : "5668b1c743887bdd5bf174cc" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第10条（サービス内容の変更等）  当組織は，ユーザーに通知することなく，本サービスの内容を変更しまたは本サービスの提供を中止することができるものとし，これによってユーザーに生じた損害について一切の責任を負いません。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第10条（サービス内容の変更等）  当組織は，ユーザーに通知することなく，本サービスの内容を変更しまたは本サービスの提供を中止することができるものとし，これによってユーザーに生じた損害について一切の責任を負いません。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:57:11.574+0900" }, "update_date" : { "$date" : "2015-12-10T07:57:11.574+0900" }, "deleted" : false }
