{ "_id" : { "$oid" : "5668b1f543887bdd5bf174ce" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第9条（保証の否認および免責事項）  当組織は，本サービスに事実上または法律上の瑕疵（安全性，信頼性，正確性，完全性，有効性，特定の目的への適合性，セキュリティなどに関する欠陥，エラーやバグ，権利侵害などを含みます。）がないことを明示的にも黙示的にも保証しておりません。  当組織は，本サービスに起因してユーザーに生じたあらゆる損害について一切の責任を負いません。ただし，本サービスに関する当組織とユーザーとの間の契約（本規約を含みます。）が消費者契約法に定める消費者契約となる場合，この免責規定は適用されません。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第9条（保証の否認および免責事項）  当組織は，本サービスに事実上または法律上の瑕疵（安全性，信頼性，正確性，完全性，有効性，特定の目的への適合性，セキュリティなどに関する欠陥，エラーやバグ，権利侵害などを含みます。）がないことを明示的にも黙示的にも保証しておりません。  当組織は，本サービスに起因してユーザーに生じたあらゆる損害について一切の責任を負いません。ただし，本サービスに関する当組織とユーザーとの間の契約（本規約を含みます。）が消費者契約法に定める消費者契約となる場合，この免責規定は適用されません。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:57:57.554+0900" }, "update_date" : { "$date" : "2015-12-10T07:57:57.554+0900" }, "deleted" : false }
