{ "_id" : { "$oid" : "5668b21243887bdd5bf174d0" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "（1）本規約のいずれかの条項に違反した場合  （2）登録事項に虚偽の事実があることが判明した場合  （3）破産，民事再生，会社更生または特別清算の手続開始決定等の申立がなされたとき  （4）1年間以上本サービスの利用がない場合  （5）当組織からの問い合わせその他の回答を求める連絡に対して30日間以上応答がない場合  （6）第2条第2項各号に該当する場合  （7）その他，当組織が本サービスの利用を適当でないと判断した場合", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/（1）本規約のいずれかの条項に違反した場合  （2）登録事項に虚偽の事実があることが判明した場合  （3）破産，民事再生，会社更生または特別清算の手続開始決定等の申立がなされたとき  （4）1年間以上本サービスの利用がない場合  （5）当組織からの問い合わせその他の回答を求める連絡に対して30日間以上応答がない場合  （6）第2条第2項各号に該当する場合  （7）その他，当組織が本サービスの利用を適当でないと判断した場合", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:58:26.655+0900" }, "update_date" : { "$date" : "2015-12-10T07:58:26.655+0900" }, "deleted" : false }
{ "_id" : { "$oid" : "5668b21d43887bdd5bf174d1" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第8条（利用制限および登録抹消）  当組織は，以下の場合には，事前の通知なく，投稿データを削除し，ユーザーに対して本サービスの全部もしくは一部の利用を制限しまたはユーザーとしての登録を抹消することができるものとします。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第8条（利用制限および登録抹消）  当組織は，以下の場合には，事前の通知なく，投稿データを削除し，ユーザーに対して本サービスの全部もしくは一部の利用を制限しまたはユーザーとしての登録を抹消することができるものとします。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:58:37.042+0900" }, "update_date" : { "$date" : "2015-12-10T07:58:37.042+0900" }, "deleted" : false }
