{ "_id" : { "$oid" : "5668b23443887bdd5bf174d3" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "ユーザーが本サービスを利用して投稿または編集した文章，画像，映像等の著作権については，当該ユーザーその他既存の権利者に留保されるものとします。ただし，当組織は，本サービスを利用して投稿または編集された文章，画像，映像等を利用できるものとし，ユーザーは，この利用に関して，著作者人格権を行使しないものとします。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/ユーザーが本サービスを利用して投稿または編集した文章，画像，映像等の著作権については，当該ユーザーその他既存の権利者に留保されるものとします。ただし，当組織は，本サービスを利用して投稿または編集された文章，画像，映像等を利用できるものとし，ユーザーは，この利用に関して，著作者人格権を行使しないものとします。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:59:00.471+0900" }, "update_date" : { "$date" : "2015-12-10T07:59:00.471+0900" }, "deleted" : false }
{ "_id" : { "$oid" : "5668b23e43887bdd5bf174d4" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第7条（著作権）  ユーザーは，自ら著作権等の必要な知的財産権を有するか，または必要な権利者の許諾を得た文章，画像や映像等の情報のみ，本サービスを利用し，投稿または編集することができるものとします。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第7条（著作権）  ユーザーは，自ら著作権等の必要な知的財産権を有するか，または必要な権利者の許諾を得た文章，画像や映像等の情報のみ，本サービスを利用し，投稿または編集することができるものとします。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T07:59:10.069+0900" }, "update_date" : { "$date" : "2015-12-10T07:59:10.069+0900" }, "deleted" : false }
