{ "_id" : { "$oid" : "5668b27d43887bdd5bf174d8" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "（7）当組織のサービスに関連して，反社会的勢力に対して直接または間接に利益を供与する行為  （8）当組織，本サービスの他の利用者または第三者の知的財産権，肖像権，プライバシー，名誉その他の権利または利益を侵害する行為  （9）過度に暴力的な表現，露骨な性的表現，人種，国籍，信条，性別，社会的身分，門地等による差別につながる表現，自殺，自傷行為，薬物乱用を誘引または助長する表現，その他反社会的な内容を含み他人に不快感を与える表現を，投稿または送信する行為  （10）営業，宣伝，広告，勧誘，その他営利を目的とする行為（当組織の認めたものを除きます。），性行為やわいせつな行為を目的とする行為，面識のない異性との出会いや交際を目的とする行為，他のお客様に対する嫌がらせや誹謗中傷を目的とする行為，その他本サービスが予定している利用目的と異なる目的で本サービスを利用する行為  （11）宗教活動または宗教団体への勧誘行為  （12）その他，当組織が不適切と判断する行為", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/（7）当組織のサービスに関連して，反社会的勢力に対して直接または間接に利益を供与する行為  （8）当組織，本サービスの他の利用者または第三者の知的財産権，肖像権，プライバシー，名誉その他の権利または利益を侵害する行為  （9）過度に暴力的な表現，露骨な性的表現，人種，国籍，信条，性別，社会的身分，門地等による差別につながる表現，自殺，自傷行為，薬物乱用を誘引または助長する表現，その他反社会的な内容を含み他人に不快感を与える表現を，投稿または送信する行為  （10）営業，宣伝，広告，勧誘，その他営利を目的とする行為（当組織の認めたものを除きます。），性行為やわいせつな行為を目的とする行為，面識のない異性との出会いや交際を目的とする行為，他のお客様に対する嫌がらせや誹謗中傷を目的とする行為，その他本サービスが予定している利用目的と異なる目的で本サービスを利用する行為  （11）宗教活動または宗教団体への勧誘行為  （12）その他，当組織が不適切と判断する行為", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T08:00:13.633+0900" }, "update_date" : { "$date" : "2015-12-10T08:00:13.633+0900" }, "deleted" : false }
