{ "_id" : { "$oid" : "5668b2aa43887bdd5bf174db" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第3条（ユーザーIDおよびパスワードの管理）  ユーザーは，自己の責任において，本サービスのユーザーIDおよびパスワードを管理するものとします。  ユーザーは，いかなる場合にも，ユーザーIDおよびパスワードを第三者に譲渡または貸与することはできません。当組織は，ユーザーIDとパスワードの組み合わせが登録情報と一致してログインされた場合には，そのユーザーIDを登録しているユーザー自身による利用とみなします。", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第3条（ユーザーIDおよびパスワードの管理）  ユーザーは，自己の責任において，本サービスのユーザーIDおよびパスワードを管理するものとします。  ユーザーは，いかなる場合にも，ユーザーIDおよびパスワードを第三者に譲渡または貸与することはできません。当組織は，ユーザーIDとパスワードの組み合わせが登録情報と一致してログインされた場合には，そのユーザーIDを登録しているユーザー自身による利用とみなします。", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T08:00:58.640+0900" }, "update_date" : { "$date" : "2015-12-10T08:00:58.640+0900" }, "deleted" : false }
{ "_id" : { "$oid" : "5668b2c343887bdd5bf174dc" }, "name" : "Master", "id" : "566878c9f759de554b6a842b", "contents" : "第2条（利用登録）  登録希望者が当組織の定める方法によって利用登録を申請し，当組織がこれを承認することによって，利用登録が完了するものとします。  当組織は，利用登録の申請者に以下の事由があると判断した場合，利用登録の申請を承認しないことがあり，その理由については一切の開示義務を負わないものとします。  （1）利用登録の申請に際して虚偽の事項を届け出た場合  （2）本規約に違反したことがある者からの申請である場合  （3）未成年者，成年被後見人，被保佐人または被補助人のいずれかであり，法定代理人，後見人，保佐人または補助人の同意等を得ていなかった場合  （4）反社会的勢力等（暴力団，暴力団員，右翼団体，反社会的勢力，その他これに準ずる者を意味します。）である，または資金提供その他を通じて反社会的勢力等の維持，運営もしくは経営に協力もしくは関与する等反社会的勢力との何らかの交流もしくは関与を行っていると当組織が判断した場合  （5）その他，当組織が利用登録を相当でないと判断した場合", "my_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。/第2条（利用登録）  登録希望者が当組織の定める方法によって利用登録を申請し，当組織がこれを承認することによって，利用登録が完了するものとします。  当組織は，利用登録の申請者に以下の事由があると判断した場合，利用登録の申請を承認しないことがあり，その理由については一切の開示義務を負わないものとします。  （1）利用登録の申請に際して虚偽の事項を届け出た場合  （2）本規約に違反したことがある者からの申請である場合  （3）未成年者，成年被後見人，被保佐人または被補助人のいずれかであり，法定代理人，後見人，保佐人または補助人の同意等を得ていなかった場合  （4）反社会的勢力等（暴力団，暴力団員，右翼団体，反社会的勢力，その他これに準ずる者を意味します。）である，または資金提供その他を通じて反社会的勢力等の維持，運営もしくは経営に協力もしくは関与する等反社会的勢力との何らかの交流もしくは関与を行っていると当組織が判断した場合  （5）その他，当組織が利用登録を相当でないと判断した場合", "parent_hierarchy" : "/使い方/禁止事項/その他使用許諾契約に反するもの。使用許諾契約の全文を表示するにはこの投稿をタップしてください。", "image_num" : 6, "red" : 1, "green" : 1, "blue" : 1, "create_ip" : "42.126.140.138", "create_date" : { "$date" : "2015-12-10T08:01:23.199+0900" }, "update_date" : { "$date" : "2015-12-10T08:01:23.199+0900" }, "deleted" : false }
